import { useParams } from 'react-router-dom';

const Blogs = ({ blog }) => {
    const { id } = useParams();
    return (
        <>
            <h1>Blog - {id}</h1>
            <h1>{blog.title}</h1>
            <h4>{blog.author}</h4>
            <h5>{blog.body}</h5>
        </>
    );
}

export default Blogs;
